pragma solidity ^0.4.24;

contract Mortal {
    /* Define variable owner of the type address */
    address public owner;


    /* This function is executed at initialization and sets the owner of the contract */
    constructor() public{ owner = msg.sender; }

    /* Function to recover the funds on the contract */
    function kill() public { if (msg.sender == owner) selfdestruct(owner); }
}

contract Greeter is Mortal {
    /* Define variable greeting of the type string */
    address private greeter;
    address private client;
    bytes private greeting;
    uint private payout;
    uint private price;
    string private name;
    /* This runs when the contract is executed */
    constructor(string n, bytes b) public {
        greeter = msg.sender;
        name = n;
        greeting = b;
    }

    function registerClient() public {
        client = msg.sender;
    }

    function getPrice() public returns (uint) {
        return price;
    }


    /* Main function */
    function greet() public payable returns (bytes) {
        require(msg.sender == client, "You are not the buyer");
        require(msg.value == 2 * price, "You did not provide an adequate amount of money");
        greeter.transfer(msg.value);
        client = address(0);
        return greeting;
    }

    function setPrice() public payable{
        require(msg.sender == greeter, "Only the owner of this contract can set the price");
        price = msg.value;
    }
}
